

fun main(args: Array<String>) {
    val code =""

    println(Day5.part1(code))
    println(Day5.part2(code))
}

object Day5 {

    fun part1(code: String): String {
        var finalCode = code
        var prev: Char? = null
        var i = 0

        while(i < finalCode.length) {

            val char = finalCode[i]
            val prevCharLower = prev?.toLowerCase()
            val charLower = char.toLowerCase()

            if (charLower == prevCharLower) {
                if (char != prev) {
                    val initRange = Math.max(i-1, 0)
                    val endRange = Math.min(i+1, finalCode.length-1)
                    finalCode = finalCode.removeRange(initRange, endRange)
                    i = Math.max(0, i-2)
                    prev = null
                    continue
                }
            }
            i++
            prev = char
        }

       return finalCode.length.toString()
    }

    fun part2(code: String): String {
        var min = Int.MAX_VALUE

        for(i in 97..122) {
            val lower = i.toChar()
            val upper = (i-32).toChar()
            val units = part1(code.filterNot { it == lower || it == upper })

            if (units.toInt() < min) {
                min = units.toInt()
            }
        }

        return min.toString()
    }

}


